import React from "react";
import { Link } from "react-router-dom";

const Productt = ({id, name, brand, imgUrl, price, currency }) => {
    return (
        <Link className=" flex flex-col align-center mr-6 mb-4 px-2 py-6 transform hover:scale-105 hover:shadow-xl transition delay-50 ease-in-out " to={`/about/${id}`}>
                        <img width='120' src={`https://${imgUrl}`} alt={name} className=" mx-auto mb-6"  />
                        <p className=" text-yellow text-sm lowercase font-font-krona">{name}</p>
                        <p>{brand}</p>
                        <div>
                            <p className=" font-font-krona text-lg">
                                {price} {currency}
                            </p>
                            <div className=" w-10 h-10 absolute rounded"></div>
                        </div>
                        
                </Link>
    )
}

export default Productt
